\u1ed1 (CVV).","1463013":{"__html":"Th\u1ebb n\u00e0y \u0111\u00e3 b\u1ecb t\u1eeb ch\u1ed1i. Vui l\u00f2ng x\u00e1c minh t\u1ea5t c\u1ea3 th\u00f4ng tin th\u1ebb b\u1ea1n \u0111\u00e3 cung c\u1ea5p l\u00e0 ch\u00ednh x\u00e1c v\u00e0 th\u1eed l\u1ea1i. \u003Cbr>\u003Cbr>N\u1ebfu b\u1ea1n ti\u1ebfp t\u1ee5c g\u1eb7p ph\u1ea3i nh\u1eefng s\u1ef1 c\u1ed1 n\u00e0y, li\u00ean h\u1ec7 ng\u00e2n h\u00e0ng ho\u1eb7c ng\u01b0\u1eddi ph\u00e1t h\u00e0nh th\u1ebb \u0111\u1ec3 t\u00ecm ra nguy\u00ean nh\u00e2n th\u1ebb b\u1ecb t\u1eeb ch\u1ed1i."},"1463014":{"__html":"\u0110\u1ecba ch\u1ec9 l\u1eadp h\u00f3a \u0111\u01a1n c\u1ee7a b\u1ea1n kh\u00f4ng th\u1ec3 x\u00e1c minh \u0111\u01b0\u1ee3c. Vui l\u00f2ng \u0111\u1ea3m b\u1ea3o r\u1eb1ng \u0111\u1ecba ch\u1ec9 l\u1eadp h\u00f3a \u0111\u01a1n ch\u00ednh x\u00e1c nh\u01b0 \u0111\u1ecba ch\u1ec9 tr\u00ean b\u1ea3n k\u00ea giao d\u1ecbch l\u1eadp h\u00f3a \u0111\u01a1n. \u003Cbr>\u003Cbr>N\u1ebfu b\u1ea1n ti\u1ebfp t\u1ee5c nh\u1eadn \u0111\u01b0\u1ee3c tin nh\u1eafn n\u00e0y, h\u00e3y li\u00ean h\u1ec7 v\u1edbi nh\u00e0 cung c\u1ea5p th\u1ebb t\u00edn d\u1ee5ng c\u1ee7a b\u1ea1n \u0111\u1ec3 \u0111\u1ea3m b\u1ea3o r\u1eb1ng th\u1ebb \u0111\u00e3 c\u1eadp nh\u1eadt. Trong khi ch\u1edd \u0111\u1ee3i, vui l\u00f2ng t\u1eed th\u00eam ph\u01b0\u01a1ng ph\u00e1p thanh to\u00e1n kh\u00e1c \u0111\u1ec3 ho\u00e0n th\u00e0nh mua h\u00e0ng c\u1ee7a b\u1ea1n."},"1463015":"\u0110\u00e3 x\u1ea3y ra s\u1ef1 c\u1ed1 khi th\u00eam th\u1ebb n\u00e0y v\u00e0o t\u00e0i kho\u1ea3n c\u1ee7a b\u1ea1n. \u0110\u1eebng lo l\u1eafng, b\u1ea1n kh\u00f4ng b\u1ecb t\u00ednh ph\u00ed cho giao d\u1ecbch n\u00e0y.","1463016":"Ch\u00fang t\u00f4i r\u1ea5t ti\u1ebfc, nh\u01b0ng \u0111\u00e3 x\u1ea3y ra s\u1ef1 c\u1ed1 khi truy c\u1eadp th\u1ebb t\u00edn d\u1ee5ng ch\u01b0a l\u01b0u c\u1ee7a b\u1ea1n. Vui l\u00f2ng nh\u1eadp l\u1ea1i th\u00f4ng tin th\u1ebb t\u00edn d\u1ee5ng c\u1ee7a b\u1ea1n ho\u1eb7c th\u00eam m\u1ed9t th\u1ebb m\u1edbi.","1463017":"\u0110\u00